import React, { Fragment } from "react";
import Link from "next/link";

const NavbarItems = (props) => {
  return (
    <Fragment>
      {props.subMenu ? (
        <li className="dropdown">
          <NavLink
            className="navLink disabled-link"
            exact
            activeClassName="selected"
            to={props.path}
          >
            {props.title}
          </NavLink>
          <ul className="dropdown-content">
            <li>
              <NavLink className="lighter subItems" exact to="/sss">
                زیر منو
              </NavLink>
            </li>
            <li>
              <NavLink className="lighter subItems" exact to="/sss">
                زیر منو
              </NavLink>
            </li>
            <li>
              <NavLink className="lighter subItems" exact to="/sss">
                زیر منو
              </NavLink>
            </li>
          </ul>
        </li>
      ) : (
        <li>
          <Link href={props.path}>
            <a className="navLink" exact activeClassName="selected">
              {props.title}
            </a>
          </Link>
        </li>
      )}
    </Fragment>
  );
};

export default NavbarItems;
